import React from 'react';
import { Link } from 'react-router-dom';

function TrackOrders() {
    return (
        <div>
            <h1>Track Orders</h1>
            <input type="text" placeholder="Enter Order Id" className="form-control" />           
        </div>
    );
}

export default TrackOrders;
